(function(){Template.__checkName("consent"),Template.consent=new Template("Template.consent",function(){var t=this;return HTML.Raw('<div id="welcome-instruction" class="instruction">\n\n\t\t<h2>We need your consent to proceed...</h2>\n\n\t\t<div>\n\t\t\t<h4>Microsoft Research Project Participation Consent Form</h4>\n\t\t\t<p>\n\t\t\t\tThis research project has been reviewed and approved by the Microsoft Research Ethics Advisory Board.\n\t\t\t</p>\n\t\t\t<h4>Introduction</h4>\n\t\t\t<p>\n\t\t\t\tThank you for deciding to volunteer in a Microsoft Research project. The researchers are studying prediction. The research project will consist of predicting the outcome of speed dating events.<br>\n\t\t\t\tPlease note that you have no obligation to participate and you may decide to terminate your participation at any time. Below is a description of the research project, and your consent to participate. Please read this information carefully. If you agree to participate, click "I agree" to indicate that you have read and understood the information provided on this consent form.\n\t\t\t</p>\n\t\t\t<h4>Title of Research Project</h4>\n\t\t\t<p>Predicting Speed Dating Outcomes</p>\n\t\t\t<h4>Benefits and Risks</h4>\n\t\t\t<p>We anticipate no potential risks. The specific responses you provide will have no real-world impact on existing persons or institutions.</p>\n\t\t\t<h4>Personal Information</h4>\n\t\t\t<p>This waiver is intended to give you informed consent regarding your participation in this project and also to protect your personally identifiable information by not asking for specific details, such as your name. By clicking "I agree" at the end of this form, you are agreeing that you\'ve had time to read and consider this consent waiver and are comfortable with what is being asked of you as a participant. Aside from your Mechanical Turk ID, no personal information will be collected during this study. Your Mechanical Turk ID will not be shared outside of Microsoft Research and the confines of this study without your permission, and will be promptly deleted after compensation has been successfully provided (30 days or less). De-identified data may be used for future research or given to another investigator for future use without additional consent.</p>\n\t\t\t<h4>Research Data &amp; Feedback</h4>\n\t\t\t<p>You give your permission to our research team at Microsoft Research to collect information about your participation in the research project in the formats and medium ("Data") described above. Microsoft shall own and control all Data in connection with the research project. You may also provide suggestions, comments or other feedback ("Feedback") to Microsoft with respect to the research project. Feedback is entirely voluntary and the research team at Microsoft shall be free to use, disclose, license, or otherwise distribute, and exploit the Feedback and Data as authorized by the research participant. If you work for Microsoft, no Data or Feedback collected from you will be shared directly with anyone in your management chain.\n\t\t\tTo learn more about Microsoft\'s Privacy Policy, please visit: privacy.microsoft.com.\n\t\t\t</p>\n\t\t\t<h4>Your Authority to Participate</h4>\n\t\t\t<p>You represent that you have the full right and authority to sign this form, and if you are a minor that you have the consent (as indicated below) of your legal guardian to sign and acknowledge this form. You assume the full risk of any injuries, damages, or losses you may sustain as a result of your participation in the project. In addition, you agree to release and hold harmless Microsoft and its affiliates from any and all claims that you may have now or in the future related to or arising from your participation in the research project, and you hereby waive all such claims. Microsoft will not be liable for any damages related to your participation in the project.<br>\n\t\t\tBy clicking "I agree" below, you confirm that you consent to all of the above. Should you have any questions concerning this project, please contact us at decisionresearchlab@outlook.com.</p>\n\t\t\t<p>Please confirm your acceptance by clicking "I agree". Please print this page for your records.\n\t\t\tOn behalf of Microsoft, we thank you for your participation.</p>\n\n\t\t\t<p><b>Do you understand and consent to these terms?</b><br>\n\t\t\t<input type="radio" name="consent" value="yes"> I agree.<br>\n  \t\t\t<input type="radio" name="consent" value="no"> No thanks, I do not want to do this HIT.<br>\n  \t\t\t</p>\n  \t\t\t<p id="error-block" class="red">\n\t\t\t\t<b><i>Thanks for taking time to read the consent form. If you do not want to do this HIT, please return it.</i></b>\n\t\t\t</p>\n\t\t</div>\n\t\t\n\t</div>\n\t\n\t<div id="buttonArea" align="center">\n\t\t<a href="" id="welcome-btn" class="button-warning">Next</a>\n\t</div>')})}).call(this);

