(function(){Template.__checkName("welcome"),Template.welcome=new Template("Template.welcome",function(){var t=this;return HTML.Raw('<div id="welcome-instruction" class="instruction">\n\n\t\t<h2>Predicting Love At First Sight!</h2>\n\n\t\t<div>\n\t\t\t<p>\n\t\t\t\tDo you think romance can be predicted? Can you predict love at first sight? Take this HIT to find out! \n\t\t\t</p>\n\t\t\t<p>\n\t\t\t\tIn this HIT, you will be asked to complete a sequence of 40 prediction tasks. For each task, you will see the profile of one participant in a speed dating event along with some information about his or her date. You will be asked to predict <b>whether the participant indicated that he or she would like to see this date again </b>at the end of the speed dating event.   \n\t\t\t</p>\n\t\t\t\x3c!--<p id="bonusStatement">\n\t\t\t\t<span class=\'red\'><b>You will have the opportunity to earn bonuses in this HIT!</b></span> Specifically, you can earn an additional bonus of <b><span id=\'bonus\' class=\'red\'>10 cents</span></b> for each correct prediction that you make.\n\t\t\t</p>--\x3e\n\t\t\t<p>\n\t\t\t\tUsing data about other similar speed dating participants, we have also trained a machine learning algorithm to predict whether someone would like to see his or her date again after the speed dating event. <b>For each task, the prediction of this algorithm is provided for your reference</b>. \n\t\t\t</p>\n\t\t\t<p>\n\t\t\t\tYou can take this HIT only once.\n\t\t\t</p>\n\t\t\t<p>Sound interesting? Push the button below to start predicting love!</p>\n\t\t\t<br>\n\t\t\t<p id="error-block" class="red">\n\t\t\t\t<b><i>You are allowed to take this HIT only once and you have already done that. Please return this HIT.</i></b>\n\t\t\t</p>\n\t\t</div>\n\t\t\n\t</div>\n\t\n\t<div id="buttonArea" align="center">\n\t\t<a href="" id="welcome-btn" class="button-warning">Let\'s Predict Love!</a>\n\t</div>')})}).call(this);

